	add("queef", "{\"term\":\"queef\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"scots\"], \"text\":\"Origin uncertain, perhaps a variant form of \u0027quiff\u0027 (trick, ploy) or \u0027quiff\u0027 (woman; vulva) Perhaps compare Scots \u0027queef\u0027 \u0026lt;ref\u0026gt;{{quote-book | date \u003d 2010-10-16 | title \u003d Where a Dobdob Meets a Dikdik: A Word Lover\u0027s Guide to the Weirdest, Wackiest, and Wonkiest Lexical Gems | first \u003d Bill | last \u003d Casselman | location \u003d Avon | publisher \u003d Adams Media | edition \u003d Original | isbn \u003d 9781440506369 | ol \u003d 24539105M | page \u003d 191 | passage \u003d \u0027\u0027Queef\u0027\u0027 is Scottish slang, a pronunciation variant of quiff, meaning “vulva” or “vagina”. This, together with British nautical slang where a \u0027\u0027queef\u0027\u0027 is also a dialectic variant of quiff meaning “a blast of wind,” combined sometime during the last 200 years in vulgar street talk to give the current meaning of \u0027\u0027queef\u0027\u0027: an explusion of air from the vulva during or often just after vigorous intercourse, commonly called a pussy fart.}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An emission of air from the vagina, especially when noisy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Was that a fart or a \u0027\u0027queef\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A contemptible person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title \u003d season \u003d 3 number \u003d 17 passage \u003d \u0027Tough Guy:\u0027 Oh yeah? Well, you look like a bunch of \u0027\u0027queefs\u0027\u0027 to me, huh\", \"priority\":4}]}, \"synonyms\":{}}");

