	add("query", "{\"term\":\"query\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"An anglicisation of \u0027\u0027 an obsolete variant form of Latin \u0027quaere\u0027 second-person singular present active imperative of \u0027quaerō\u0027 (seek, look for; ask) Compare {{l|en|question}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A question, an inquiry , an enquiry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The teacher answered the student\u0027s \u0027\u0027query\u0027\u0027 concerning biosynthesis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A question mark\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Oliver Sacks, \u0027Awakenings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had written in her diary: \u0026quot;I don\u0027t \u0027think\u0027 I am in a concentration-camp??????\u0026quot;, the \u0027\u0027queries\u0027\u0027 growing larger and more numerous till they covered the entire page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0026quot;Pip\u0026quot;, \u0027Re: Royal Enfield motorbike - why would anyone buy one?\u0027 (on newsgroup \u0027rec.motorcycles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I refer you to your line above, where you use a \u0027\u0027query\u0027\u0027 and a bang together\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A set of instructions passed to a database\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The database admin switched on \u0027\u0027query\u0027\u0027 logging for debugging purposes\", \"priority\":9}]}, \"synonyms\":{}}");

	add("quercitin", "{\"term\":\"quercitin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flavonoid found in fruits, vegetables, leaves and grains\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, D. G. Lindsay, \u00277: Nutritional enhancement of plant foods\u0027, Victoriano Valpuesta (editor), \u0027Fruit and Vegetable Biotechnology\u0027, [https://books.google.com.au/books?id\u003dID9DZOBQZhQC\u0026amp;pg\u003dPA174\u0026amp;dq\u003d%22quercitin%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quercitin%22\u0026amp;f\u003dfalse page 174\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Quercitin\u0027\u0027-β-glucoside is more easily absorbed than the aglycone \u0027\u0027quercitin\u0027\u0027. Isorhamnetin-β-glucoside, which is chemically similar to \u0027\u0027quercitin\u0027\u0027, differing only by a single methoxyl group, is more readily absorbed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Willem Serfontein, \u0027Did Your Doctor Tell You?\u0027, [https://books.google.com.au/books?id\u003dyr2MkW6hyRgC\u0026amp;pg\u003dPA17\u0026amp;dq\u003d%22quercitin%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quercitin%22\u0026amp;f\u003dfalse page 17\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Here again the consumption of a bioflavonoid (\u0027\u0027quercitin\u0027\u0027) was related to the incidence of CAD mortality. It was found that men who consumed (from the diet) less than 10 mg per day of \u0027\u0027quercitin\u0027\u0027 had a 200% increase in the CAD death rate, compared to those who consumed more than 30 mg\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, George Aiken, \u00272: Fluorescence and Dissolved Organic Matter: A Chemist\u0027s Perspective\u0027, Paula Coble, Jamie Lead, Andy Baker, Darren Reynolds, Robert G. M. Spencer (editors), \u0027Aquatic Organic Matter Fluorescence\u0027, [https://books.google.com.au/books?id\u003d4N7GAwAAQBAJ\u0026amp;pg\u003dPA48\u0026amp;dq\u003d%22quercitin%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quercitin%22\u0026amp;f\u003dfalse page 48\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In the case of the flavanol \u0027\u0027quercitin\u0027\u0027, the absorption spectrum of \u0027\u0027quercitin\u0027\u0027 itself was red-shifted and its fluorescence intensity increased, while the fluorescence intensity of albumin was quenched\", \"priority\":10}]}, \"synonyms\":{}}");

	add("querencia", "{\"term\":\"querencia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027querencia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The area of the bull-ring where the bull makes its stand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027A Savage War of Peace\u0027, New York Review Books 2006, p. 332\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Once hit, a rebel unit must be hit again, and remain hit; the army must penetrate the \u0027\u0027\u0027querencia\u0027\u0027\u0027 where – like a fighting bull – it was at home, and stay there, driving it out into unknown and unfriendly territory\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027The Crossing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The wolf paced and circled limping on three legs and then crouched by the iron stake where it seemed she’d made her \u0027\u0027querencia\", \"priority\":5}]}, \"synonyms\":{}}");

