	add("question", "{\"term\":\"question\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|question|question, questioun, questiun}}, from Anglo-norman {{m|fro|questiun}}, from Old french (842-ca. 1400) {{m|fro|question}}, from Latin {{m|la|quaestionem}}, accusative of {{m|la|quaestio||a seeking, investigation, inquiry, question}}, from {{m|la|quaerere||to seek, ask, inquire}}.\u0026lt;ref name\u003d\u0026quot;Cent1911\u0026quot;\u0026gt;{{R:Century 1911}}\u0026lt;/ref\u0026gt; Displaced native Middle english (1100-1500) {{m|enm|frain|frain, fraign|question}} (from Old english (ca. 450-1100) {{m|ang|fræġn}}); compare Middle english (1100-1500) {{m|enm|frainen|frainen, freinen|to inquire, question}}, Middle english (1100-1500) {{m|enm|afrainen|afrainen, affrainen|to question}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sentence, phrase or word which asks for information, reply or response; an interrogative\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dI told him about everything I could think of; and what I couldn\u0027t think of he did. He asked about six \u0027\u0027questions\u0027\u0027 during my yarn, but every \u0027\u0027question\u0027\u0027 had a point to it. At the end he bowed and thanked me once more. As a thanker he was main-truck high; I never see anybody so polite\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A subject or topic for consideration or investigation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A doubt or challenge about the truth or accuracy of a matter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The story is true beyond \u0027\u0027question\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He obeyed without \u0027\u0027question\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Bible, John iii. 2\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"There arose a \u0027\u0027question\u0027\u0027 between some of John\u0027s disciples and the Jews about purifying\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"It is to be to \u0027\u0027question\u0027\u0027, whether it be lawful for Christian princes to make an invasive war simply for the propagation of the faith\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A proposal to a meeting as a topic for deliberation\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"interrogation by tortur\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The Scottish privy council had power to put state prisoners to the \u0027\u0027question\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Talk; conversation; speech\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Made she no verbal \u0027\u0027question\u0027\u0027?\u0027 Shakespeare King Lear ca. 1606\", \"priority\":16}]}, \"synonyms\":{}}");

